Lego Star Wars 75357  Ghost ve Phantom II
Hayranlar, Ghost ve Phantom II (75357) starship’lerinin bu LEGO® versiyonlarıyla unutulmaz Star Wars: Ahsoka sahnelerini canlandırabilir. İnşa edilebilen Ghost modeli, kolla çalışan 2 yaylı atıcıya, çıkarılabilir ön bölümlü ikili LEGO minifigür kokpitine, açılan 2 kapaklı bir kabine, (ateş etmeyen) toplu ayrılabilir bir tarete ve bir LEGO minifigürü için yere sahiptir. Phantom II mekiği, açılan bir minifigür kokpitine ve saklama bölmesine sahiptir. Ayrıca General Hera Syndulla LEGO minifigürü ve bir Chopper (C1-10P) LEGO droid figürü dahil 5 Star Wars™ figürü içerir. Model yapmanın yeni bir yolu Gerçek yapım modellerinin 3 boyutlu dijital versiyonlarını yakınlaştırıp döndürmek, ilerlemeyi takip etmek ve setleri kaydetmek için araçlara sahip olan LEGO Builder uygulamasıyla yaratıcı deneyime ekstra bir boyut katın. Hediye fikri Bu yapım oyuncağı, 10 yaş ve üzeri çocuklar için muhteşem bir hediyedir ve her yaştan Star Wars hayranını heyecanlandıracak devasa Star Wars setleri serisinin bir parçasıdır.;

İnşa edilebilen starship oyun seti (75357) – LEGO® parçalarıyla inşa edilen Ghost ve Phantom II starship’leriyle aksiyon dolu Star Wars: Ahsoka hikayelerini canlandırın;
4 LEGO® Star Wars™ minifigürü – İkisi de blaster silahlı General Hera Syndulla ve Teğmen Beyta, Jacen Syndulla ve İkinci Kaptan Hawkins, ayrıca bir Chopper (C1-10P) LEGO droid figürü;
Ghost – Kolla çalışan 2 yaylı atıcı, ön tarafı çıkarılabilir ikili LEGO® minifigür kokpiti, 2 açılan kapak ve bir LEGO minifigürü için yeri olan ayrılabilir bir taret içerir;
Phantom II – Bu mekik, açılan bir LEGO® minifigür kokpitine ve saklama bölmesine sahiptir ve Ghost’a bağlanabilir;
10 yaş ve üzeri için hediye fikri – Bu 1394 parçalı LEGO® yapım setini, Star Wars: Ahsoka hayranlarına doğum günü, yılbaşı hediyesi veya özel bir ödül olarak verin;
İnşa edin ve oynayın – Ghost starship’inin yüksekliği 12 cm, uzunluğu 34 cm, genişliği 26 cm’dir;
Sezgisel talimatlar – LEGO® Builder uygulaması, modeli inşa ederken gerçek yapım modelinin 3 boyutlu dijital bir versiyonunu yakınlaştırmanıza ve döndürmenize, ilerlemeyi takip etmenize ve setleri kaydetmenize olanak tanır;
Her yaş için koleksiyonluk yapım oyuncakları – Çocuklar ve yetişkin Star Wars™ hayranları, LEGO® Star Wars setleriyle ünlü sahneleri canlandırabilir, kendi hikayelerini geliştirebilir veya inşa edilebilen modelleri sergileyebilir;
Birinci sınıf – LEGO® yapım parçaları katı sektör standartlarına uygundur, böylece kolayca ve sıkıca birbirine takılarak sağlam modeller oluşturur;
Güvenlik garantisi – LEGO® parçaları, titiz global güvenlik standartlarını karşıladığından emin olmak için düşürülür, ısıtılır, ezilir, bükülür ve dikkatle analiz edilir

